    that we follow an alternate method of itemizing payroll receipts rather than the
    suggested manner of disclosing a single total for the reporting period along with
    the amount deducted per pay period.  Because the amounts collected per pay period
    may change often during the time covered by a single report, we find that reporting
    individual deductions separately more accurately discloses how the receipts are
    collected.\"\n"
